contracts/StorageFactory.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.8;
import "./SimpleStorage.sol";

contract StorageFactory {
    SimpleStorage[] public simpleStorageArray;

    function createSimpleStorageContract() public {
        SimpleStorage simpleStorage = new SimpleStorage(); 
        simpleStorageArray.push(simpleStorage);
    }

    function sfStore(uint256 _simpleStorageIndex, uint256 _simpleStoragenumber) public {
        // To interact with any contract we need:
        // Address of contract
        // ABi - Application Binary Interface: This tells our code how to interact with contract.
        simpleStorageArray[_simpleStorageIndex].store(_simpleStoragenumber);
    }

    function sfGet(uint256 _simpleStorageIndex) public view returns (uint256){
        return simpleStorageArray[_simpleStorageIndex].retrieve();
    }   
}

contracts/SimpleStorage.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.8;

contract SimpleStorage {
    uint256 favNumber;
    mapping (string => uint256) public nameToFavoriteNumber;

    User public user1 = User({favNumber: 12, name: "Ahmad"});
    User public user2 = User({favNumber: 7, name: "Joseph"});

    User[] public users;

    struct User{
        uint256 favNumber;
        string name;
    }

    function store(uint256 _favNumber) public {
        favNumber = _favNumber;
    }

    function retrieve() public view returns (uint256){
        return favNumber;
    }

    function addUser(uint256 _favNumber, string memory _name) public {
        users.push(User({favNumber: _favNumber, name: _name}));
        nameToFavoriteNumber[_name] = _favNumber;
    }
}

